import { AppBar, Avatar, Box, IconButton, InputBase, Toolbar, Typography, styled } from '@mui/material'
import MenuBookIcon from '@mui/icons-material/MenuBook'
import React from 'react'
import { theme } from '../theme';
import { StayPrimaryLandscape } from '@mui/icons-material';


const StyledToolbar = styled(Toolbar)({
  display: "flex",
  justifyContent: "space-between",
});
const Search = styled("div")(({ theme }) => ({
  backgroundColor: "white",
  padding: "0 10px",
  borderRadius: theme.shape.borderRadius,
  width: "40%",
}));
const Icons = styled("div")({
  backgroundColor: "white",
})
export const NavBar = () => {

  return (
    <React.Fragment>
        <AppBar  position="sticky" sx={{background: ""}}>
            <StyledToolbar spacing={2}>
                <Typography variant="h6" sx={{display:{xs:"none", sm:"block"}}}>
                  Usedbooks By Ommm...
                </Typography>
                <MenuBookIcon sx={{display:{xs:"block", sm:"none"}}}/>

                <Search>
                  <InputBase placeholder='Find your next book here...'/>
                </Search>

              <Box sx={{display:{xs}}}>
                avatar={
                   <Avatar sx={{ bgcolor: "blue" }} aria-label="Userprofile">
                   F
                   </Avatar>
                }
              </Box>
            </StyledToolbar>
        </AppBar>
    </React.Fragment>
  )
}
export default NavBar
